import React, { Component } from 'react'
import "../Test/Test.css";
import { Link, NavLink } from "react-router-dom";
import axios from "axios";
import authService from "../../services/auth-service";
import axiosService from "../../services/axios-service";
import { API_URL } from "../../services/url";
import SimpleReactValidator from "simple-react-validator";
import { SuccessModal } from '../Test/SuccessModal';
export class AT8 extends Component {
    constructor(props) {
        super(props);
        this.state = {
          btnstatus : false,
          source: "",
          weight: "",
          agg_type: "",
          cement_type : "",
          cement_type2 : "",
          w_c_ratio : "",
          w_c_ratio2 : "",
          cem_combination  : "",
          cem_combination2 : "",
          ad_dosage : "",
          ad_dosage2 : "",
          weight_balance: "",
          weight_sample_testing: "",
          weight_sample_sieving: "",
          material_passing: "",
          pto_comment: "",
          total: "",
          amount_status: false,
          plant: localStorage.getItem("plant_name"),
          date_of_receipt: "",
          type: "AT_8",
          s_t1: "",
          s_t2: "",
          s_t3: "",s_t4 : "",s_t5 : '',s_t6 : "",s_t7  :"",s_t8: "",s_t10 : "",s_t11 : "",s_t12 : "",s_t13: "",s_t14 : "",s_t15 : "",s_t16 : "",s_t17 : "",s_t18 : "",s_t19 : "",s_t20 : "",s_t21 : "",s_t22 : "",s_t23 : "",s_t24 : "", s_t25 : "",s_t26 : "",s_t27 : "",s_t28 : "",s_t29 : "",s_t30 : "",s_t31 : "",s_t32 : "",s_t33 : "",s_t34 : "",s_t35 : "",s_t36 : "",s_t37 : '',s_t38 : "",s_t39 : "",s_t40 : "",s_t41 : "",s_t42 : '',s_t43 : "",s_t44 : "",s_t45 : "",s_t46 : "",s_t47 : "",s_t48 : "",s_t49 : "",s_t50 : "",s_t51 : "",s_t52 : "",s_t53 : "",s_t54 : "",s_t55 : "",s_t56 : "",s_t57 : "",s_t58 : "",s_t59 : "",s_t60: "", s_t61 : "",s_t62 : "", s_t63 : "",s_t64 : "",s_t65 : "",s_t66 : "",s_t67 : "",s_t68 : "",s_t69 : "",s_t70 : "", s_t71 : ""
        };
        this.onSubmit = this.onSubmit.bind(this);
        this.validator = new SimpleReactValidator();
      }
      componentWillMount = () => {
        var today = new Date();
        var dd = today.getDate();
        var mm = today.getMonth() + 1; //January is 0!
        var yyyy = today.getFullYear();

        if (dd < 10) {
          dd = "0" + dd;
        }

        if (mm < 10) {
          mm = "0" + mm;
        }

        today = mm + "/" + dd + "/" + yyyy;
        console.log("date here", today);
        this.state.date = today;
        console.log(this.state.date);
      };

      change = e => {
        this.setState({
          [e.target.name]: e.target.value
        });
      };
      openModal() {
        this.setState({
            visible : true
        });
    }

      closeModal() {
        this.setState({
            visible : false
        });
      }
      getWebsite = () => {
        fetch("/").then(console.log(this.state));
      };
      async onSubmit(event) {
        event.preventDefault();
        console.log(this.state);
        if (this.validator.allValid()) {
          let tokenvalue = localStorage.getItem("token");
          this.openModal();
          this.setState({
            btnstatus : true
          })
              try {
                const response = await axios.post(
                  `${API_URL}rf_form/submit`,
                  this.state,
                  (axios.defaults.headers.common["x-access-token"] = tokenvalue)
                );
            console.log(response);
            //   .then(console.log(this.state));

              if (response.data==='success') {
                // alert(response.data);
                this.props.history.push("/ViewAT8");
              } else {
                alert(response.data);
              }
          } catch (error) {
            console.log(error);
          }
        } else {
          this.validator.showMessages();
          // rerender to show messages for the first time
          this.forceUpdate();
        }
      }
      totalshow = e => {
        e.preventDefault();
        let total_sample_sieving = this.state.weight_sample_sieving;
        let total_sample_testing = this.state.weight_sample_testing;
        let total_amount =
          ((total_sample_testing - total_sample_sieving) / total_sample_testing) *
          100;
        this.state.total = total_amount;
        console.log(total_amount);
        this.setState({
          amount_status: true
        });
      };
      render() {
             // let showmodal;
     let sbmtbtn, btnmsg;
     if(this.state.visible)
     {
       // showmodal = (
       //   <div>
       //     <SuccessModal  
       //          visible={this.state.visible}
       //               width={this.props.width}
       //               height={this.props.height}
       //               effect={this.props.effect}
       //               onClickAway={() => this.closeModal()} />
       //   </div>
       // )
     }
     if(this.state.btnstatus)
     {
       sbmtbtn = (
         <button
         class="btn btn-primary"
         onClick={this.onSubmit.bind(this)}
         disabled
       >
         Submit
       </button>
       )
       btnmsg = (
         <div>
         <hr />
         <p>Your Form Has Already Been Submitted.Please Don't Click SUMBIT Button AGAIN!!</p>
         </div>
       )
     }
     else
     {
       sbmtbtn=(
         <button
         class="btn btn-primary"
         onClick={this.onSubmit.bind(this)}
       >
         Submit
       </button>
       )
     }
        let display_total_amount;
        if (this.state.amount_status == true) {
          display_total_amount = <div>{this.state.total} %</div>;
        } else {
          display_total_amount = (
            <div>
              <p>Enter The Above Fields</p>
            </div>
          );
        }

        return (
          <div className="skin-blue fixed-layout">
            <div className="page-wrapper">
              <div className="container-fluid">
                <div className="row page-titles">
                  <div className="col-md-5 align-self-center">
                    {/* <h4 className="text-themecolor">Forms</h4> */}
                    <nav aria-label="breadcrumb">
                      <ol class="breadcrumb">
                        <li className="breadcrumb-item">
                          <Link to={process.env.PUBLIC_URL + "/"}>Home</Link>
                        </li>
                        <li className="breadcrumb-item active" aria-current="page">
                          AT - 08
                        </li>
                      </ol>
                    </nav>
                  </div>
                </div>
              </div>

              {/*Form content begin */}

              <div className="product-form-upper">
                <div className="container-fluid">
                  <div className="below-custom-form">
                    <div className="row">
                      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        {/* <div className="custom-btn-lists">
                          <ul>
                            <li>
                              <button className="btn btn-info">
                                <NavLink
                                  activeClassName="selected"
                                  to={process.env.PUBLIC_URL + "/AT1"}
                                >
                                  AT1
                                </NavLink>
                              </button>
                            </li>
                            <li>
                              <button className="btn btn-info">
                                <NavLink
                                  activeClassName="selected"
                                  to={process.env.PUBLIC_URL + "/AT2"}
                                >
                                  AT2
                                </NavLink>
                              </button>
                            </li>
                            <li>
                              <button className="btn btn-info">
                                <NavLink
                                  activeClassName="selected"
                                  to={process.env.PUBLIC_URL + "/AT3"}
                                >
                                  AT3
                                </NavLink>
                              </button>
                            </li>
                          </ul>
                        </div>

                        <hr /> */}
                      </div>

                      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        <p style={{ textAlign: "center" }}>
                        <h3>AT -08</h3>
                        Cement benchmarking Summary 
                        </p>
                        <hr />
                      </div>
                    </div>
                    <form className="custom-content-form">
                      <div className="form-row">
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              Plant
                            </label>
                            <div class="col-sm-10">
                            {localStorage.getItem('plant_name')}

                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              Date Of Receipt
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="date"
                                class="form-control"
                                id="inputPassword"
                                name="date_of_receipt"
                                value={this.state.date_of_receipt}
                                onChange={e => this.change(e)}
                              />
                              <span className="text-danger">
                        {this.validator.message(
                          "date of receipt",
                          this.state.date_of_receipt,
                          "required"
                        )}
                      </span>
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              Reference Cement Brand 
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="ref_cem_brand"
                                value={this.state.ref_cem_brand}
                                onChange={e => this.change(e)}
                              />
                              <span className="text-danger">
                        {this.validator.message(
                          "reference cement brand",
                          this.state.ref_cem_brand,
                          "required"
                        )}
                      </span>
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputSubcategory"
                              className="col-sm-2 col-form-label"
                            >
                              Source
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="source"
                                value={this.state.source}
                                onChange={e => this.change(e)}
                              />
                              <span className="text-danger">
                        {this.validator.message(
                          "source",
                          this.state.source,
                          "required"
                        )}
                      </span>
                            </div>
                          </div>
                        </div>


                      </div>

                    </form>
                  </div>
                  {/*etst detial form */}
                  <div className="below-custom-form">
                    <div className="row">
                      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        <h3>Trial Results Summary </h3>
                        <hr />
                        <br />
                      </div>
                      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        <p>Comparative Performance - REF MIX 1</p>
                        <hr />
                      </div>
                    </div>
                    <form className="custom-content-form">
                    <div className="form-row">
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              Cement Type 
                            </label>
                            <div class="col-sm-10">
                            <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="cement_type"
                                value={this.state.cement_type}
                                onChange={e => this.change(e)}
                              />

                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                             W / C ratio 
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="w_c_ratio"
                                value={this.state.w_c_ratio}
                                onChange={e => this.change(e)}
                              />
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputPassword"
                              class="col-sm-2 col-form-label"
                            >
                              Cementitious Combination
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="cem_combination"
                                value={this.state.cem_combination}
                                onChange={e => this.change(e)}
                              />
                            </div>
                          </div>
                        </div>
                        <div class="form-group col-md-6">
                          <div class="form-group row">
                            <label
                              for="inputSubcategory"
                              className="col-sm-2 col-form-label"
                            >
                             Admixture & dosage
                            </label>
                            <div class="col-sm-10">
                              <input
                                type="text"
                                class="form-control"
                                id="inputPassword"
                                name="ad_dosage"
                                value={this.state.ad_dosage}
                                onChange={e => this.change(e)}
                              />
                            </div>
                          </div>
                        </div>


                      </div>
                      <div className="form-row">
                        <div class="form-group col-md-12">
                          <table class="table table-bordered">
                            <thead class="thead-light">
                              <tr>
                                <th scope="col">Cement Brand &amp; Source</th>
                                <th>#</th>
                                <th scope="col">Control Slump</th>
                                <th scope="col">Addedd Water</th>
                                <th scope="col" colSpan="3"><center>Slump / Flow</center></th>
                                <th scope="col" colSpan="3"><center>Average Strength</center></th>
                                <th scope="col">Remarks</th>
                              </tr>
                            </thead>
                            <tbody>
                              <tr>
                                <th scope="row" disabled>
                               </th>
                                    <td>:</td>
                                <td>
                                mm
                                </td>
                                <td>
                               mm
                                </td>
                                <td>
                               inital (mm)
                                </td>
                                <td>
                               1 Hour (mm)
                                </td>
